  render() {
    return (
      <div>
        <NavBars />
        <div className="container">
            <div className="row">
            <h1>關於疫情介紹</h1>
            </div>
        </div>
        <div className="container">
          <div className="row">
            {/* <div className="word"> */}
              <div className="col-6">
                <h3>我們提供獨立的插座</h3>
                <h4 className="text-muted">是否都會擔心沒插座可用？</h4>
                <p className="lead">
                  在 The Cave
                  不用擔心這個問題，因為每個座位都有安排自己的插座，再也不需要跟別人搶插座了!
                </p>
              {/* </div> */}
            </div>

            <div className="col-6">
              <h1>123</h1>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default About;
